// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingContract {
    struct Vote {
        uint256 userId;
        uint256 candidateId;
        uint256 electionId;
        uint256 timestamp;
    }

    Vote[] public votes; // Mng  lu tr cc phiu bu

    event VoteCast(uint256 userId, uint256 candidateId, uint256 electionId, uint256 timestamp); // S kin khi c phiu bu mi

    mapping(uint256 => mapping(uint256 => bool)) public hasVoted;

    function castVote(uint256 _userId, uint256 _candidateId, uint256 _electionId) public {

        require(!hasVoted[_userId][_electionId],  unicode"Bn  b phiu trong cuc bu c ny ri.");

        // To mt i tng Vote mi
        Vote memory newVote = Vote({
            userId: _userId,
            candidateId: _candidateId,
            electionId: _electionId,
            timestamp: block.timestamp // Ly timestamp hin ti ca block
        });

        votes.push(newVote); // Thm phiu bu vo mng

        emit VoteCast(_userId, _candidateId, _electionId, block.timestamp); // Pht ra s kin VoteCast

        hasVoted[_userId][_electionId] = true;

    }

    function checkHasVoted(uint256 _userId, uint256 _electionId) public view returns (bool) {
        return hasVoted[_userId][_electionId];
    }
    
    // Hm  ly s lng phiu bu theo electionId
    function getVoteCount(uint256 _electionId) public view returns (uint256) {
        uint256 count = 0;
        for (uint256 i = 0; i < votes.length; i++) {
            if (votes[i].electionId == _electionId) {
                count++;
            }
        }
        return count;
    }

    // Hm  ly thng tin ca mt phiu bu c th da trn index (cho mc ch kim tra)
    function getVote(uint256 index) public view returns (Vote memory) {
        require(index < votes.length, unicode"Index vt qu gii hn");        
        return votes[index];
    }

    // Hm tng hp phiu bu theo electionId
    function getElectionResults(uint _electionId) public view returns (uint[] memory, uint[] memory) {
        // m s lng ng vin trong cuc bu c
        uint totalVotes = 0;
        for (uint i = 0; i < votes.length; i++) {
            if (votes[i].electionId == _electionId) {
                totalVotes++;
            }
        }

        // Mng  lu thng tin ng vin v s phiu
        uint[] memory candidateIds = new uint[](totalVotes);
        uint[] memory voteCounts = new uint[](totalVotes);
        uint candidateCount = 0;

        // Duyt qua danh sch phiu  tng hp s phiu
        for (uint i = 0; i < votes.length; i++) {
            if (votes[i].electionId == _electionId) {
                uint candidateId = votes[i].candidateId;
                bool found = false;

                // Kim tra xem ng vin  c trong danh sch cha
                for (uint j = 0; j < candidateCount; j++) {
                    if (candidateIds[j] == candidateId) {
                        voteCounts[j]++;
                        found = true;
                        break;
                    }
                }

                // Nu ng vin cha c trong danh sch, thm mi
                if (!found) {
                    candidateIds[candidateCount] = candidateId;
                    voteCounts[candidateCount] = 1;
                    candidateCount++;
                }
            }
        }

        // Ct bt mng  ch ly s lng ng vin thc t
        assembly {
            mstore(candidateIds, candidateCount)
            mstore(voteCounts, candidateCount)
        }

        return (candidateIds, voteCounts);
    }
}
